(1, 'Terms & Conditions', '<div><p><strong><span style=\"font-size: 18pt;\">Trminos y condiciones</span></strong></p><p><br></p><p>Las presentes condiciones generales de uso e informacin legal (en adelante, Condiciones Generales) se aplican al sitio web de zaboreats.com (en adelante, Zabor) cuyo dominio es&nbsp;www.zaboreats.com&nbsp;y a la correspondiente aplicacin mvil, as como a todos sus sitios relacionados o vinculados desde&nbsp;www.zaboreats.com,&nbsp;Zabor , as como a sus afiliadas y a asociados, segn establecido en el Anexo I, incluidos los sitios web de Zabor en todo Puerto Rico (en adelante y de forma conjunta, el sitio). El sitio es propiedad de Zabor. Al utilizar el sitio, muestras tu conformidad con las presentes condiciones de uso. Si no ests de acuerdo, te rogamos te abstenga de utilizarlo.</p><p>A travs de las presentes Condiciones Generales, Zabor pone a disposicin de los usuarios (en adelante Usuario o Usuarios) el sitio web y la aplicacin mvil Zabor (en adelante denominadas conjuntamente, la Plataforma).</p><p>En cumplimiento de lo establecido en la normativa reguladora, se exponen los siguientes datos identificativos del titular del sitio:Denominacin social:Domicilio social: Urb. Alturas de Peuelas 1 Calle 7 F-37 Peuelas, P. R. 00624</p><p>Datos de inscripcin en el Registro de Comerciante : 1210696-0018Nmero de Seguro Social Patronal: 66-0942588</p><p>Patente Municipal: 00024631</p><p>Objeto</p><p>ZABOR es una compaa tecnolgica , cuya actividad principal es el desarrollo y gestin de una plataforma tecnolgica mediante la que a travs de una aplicacin mvil o de una web (en adelante, la APP) permite a determinadas tiendas locales de algunas ciudades en diferentes territorios ofertar o insertar sus productos y/o servicios a travs de la misma, y en su caso, si los usuarios de la APP y consumidores de las citadas tiendas locales as lo solicitan a travs de la APP, de forma accesoria, intermedia en la entrega inmediata de los productos.</p><p>As, Zabor ha desarrollado una Plataforma mediante la cual diferentes comercios, con los que Zabor puede mantener un acuerdo comercial por el uso de la plataforma, ofrecen y/o pueden insertar una serie de productos y servicios. El Cliente tiene la posibilidad de solicitar la adquisicin y/o recogida de productos y servicios de estos comercios, de forma presencial, mediante el mandato que confiere a un tercero al solicitar un pedido a travs de la Plataforma, en cuyos casos Zabor acta como mero intermediario y por lo tanto, no puede asumir ni asume responsabilidad alguna sobre la calidad de los productos o la correcta prestacin de los servicios ofrecidos directamente por los comercios ni por dichos terceros.Asimismo, Zabor es una Plataforma de intermediacin en la contratacin telemtica de servicios on demand . La misma pretende facilitar que aquellas personas que necesiten ayuda con sus recados, ,compras presenciales y/o recogida de productos en comercios locales (en adelante, Clientes), puedan realizar sus recados mediante y delegando en dichos terceros dispuestos a llevar a cabo voluntariamente el mandato que le confieran los Clientes (en adelante, Mandatarios).Los Mandatarios por lo tanto, son una red de profesionales independientes que colaboran con Zabor, cuando stos estn interesados en realizar la prestacin de sus servicios , se conectan a la Plataforma de Zabor y en un tiempo determinado se comprometen a realizar el servicio que le encomiende el Cliente mediante el mencionado mandato. Como consecuencia de ello, Zabor no puede asumir la responsabilidad de los plazos de entrega en tanto dependern del buen hacer de las tiendas locales, en la preparacin de los pedidos, de los propios Mandatarios, as como de la informacin facilitada por los propios usuarios al realizar el pedido o de su disponibilidad y respuesta a la hora de su entrega. A estos efectos, los plazos de entrega indicados a travs del Sitio son meramente orientativos.A lo largo de las presentes Condiciones Generales de Uso nos referiremos a Clientes y Mandatarios como Usuarios de la Plataforma.</p><p>Trminos de Uso</p><p>El acceso a la Plataforma, y la creacin voluntaria de un perfil por parte del Usuario, implica el conocimiento y la aceptacin expresa e inequvoca de las presentes Condiciones Generales de Uso y Contratacin y la Poltica de Privacidad y la Poltica de Cookies por parte de todos los Usuarios.</p><p>Acceso y Registro para Clientes</p><p>Para poder ser Cliente de la Plataforma es indispensable que se cumplan los siguientes requisitos:Haber cumplido o ser mayor de 18 aos de edad.</p><p>Cumplimentar de manera veraz los campos obligatorios del formulario de registro, en el que se solicitan datos de carcter personal como nombre de usuario, correo electrnico, nmero de telfono y nmero de tarjeta bancaria.</p><p>Aceptar las presentes Condiciones de Uso y Contratacin.Aceptar la Poltica de Privacidad y Proteccin de Datos.Aceptar la Poltica de Cookies.</p><p>El Usuario garantiza que todos los datos sobre su identidad y legitimidad facilitados a Zabor en sus formularios de registro de la Plataforma son veraces, exactos y completos. Asimismo, se compromete a mantener actualizados sus datos.En el supuesto en que el Usuario facilite cualquier dato falso, inexacto o incompleto o si Zabor considera que existen motivos fundados para dudar sobre la veracidad, exactitud e integridad de los mismos, Zabor podr denegarle el acceso y uso presente o futuro de la Plataforma o de cualquiera de sus contenidos y/o servicios.Al darse de alta en la Plataforma, el Usuario seleccionar un nombre de usuario (username) y una clave de acceso (password). Tanto el username como el password son estrictamente confidenciales, personales intransferibles. Zabor recomienda no utilizar las mismas credenciales de acceso que en otras plataformas para aumentar la seguridad de las cuentas. En el supuesto que el Usuario utilice las mismas credenciales de acceso que en otras plataformas, Zabor no podr garantizar la seguridad de la cuenta ni asegurar que el Usuario es el nico que accede a su perfil.</p><p>El Usuario se compromete a no divulgar los datos relativos a su cuenta ni hacerlos accesibles a terceros. El Usuario ser el nico responsable en caso de uso de dichos datos o de los servicios del Sitio por terceros, incluidas las manifestaciones y/o contenidos vertidos en la Plataforma, o cualquier otra actuacin que se lleve a cabo mediante el uso del username y/o password.</p><p>El usuario ser el nico propietario sobre el contenido vertido por el mismo en la Plataforma. Asimismo, a travs del registro en la Plataforma y la aceptacin de las presentes Condiciones, el Usuario concede a Zabor, en relacin con el contenido que pueda proveer, una licencia mundial, irrevocable, transferible, gratuita, con derecho a sublicencia, uso, copia, modificacin, creacin de obras derivadas, distribucin, comunicacin pblica as como su explotacin en cualquier forma que Zabor considere apropiada, con o sin comunicacin ulterior al Usuario y sin la necesidad de liquidar cantidad alguna por los mencionados usos.</p><p>Zabor no puede garantizar la identidad de los Usuarios registrados, por lo tanto, no ser responsable del uso de la identidad de un Usuario registrado por terceros no registrados. Los Usuarios se obligan a poner inmediatamente en conocimiento de Zabor la sustraccin, divulgacin o prdida de sus credenciales, comunicndolo a travs de los canales de comunicacin ofrecidos por Zabor.</p><p>3.1 Perfil</p><p>Para poder completar el registro en la Plataforma el Usuario deber proporcionar algunos datos como: nombre de Usuario, direccin de correo electrnico, telfono, datos de la tarjeta bancaria, etc. Una vez completado el registro, todo Usuario podr acceder a su perfil y completarlo, y editarlo y/o darse de baja segn estime conveniente. Zabor no almacena los datos de pago de los usuarios, que sern tratados y almacenados por el prestador de servicios de pago segn descrito en las presentes Condiciones y en la Poltica de Privacidad.</p><p>3.2. Robo o sustraccin de la tarjeta de crdito</p><p>En tanto Zabor no puede garantizar la identidad de los Usuarios registrados, los Usuarios tendrn la obligacin de informar a Zabor en aquellos supuestos en que tengan constancia que la tarjeta de crdito asociada a su perfil de Zabor hubiera sido robada, y/o se estuviera utilizando por un tercero de forma fraudulenta. Por ello, toda vez que Zabor y su plataforma de pago velan proactivamente por la proteccin de los Usuarios con las correspondientes medidas de seguridad, para el caso en que el Usuario no informara a Zabor de dicha sustraccin, Zabor no ser responsable del uso fraudulento que puedan hacer terceros de la cuenta del Usuario. Zabor invita a los Usuarios, en caso de robo, sustraccin o sospecha de un mal uso de su tarjeta de crdito a realizar la correspondiente denuncia ante la autoridad policial.</p><p>Zabor adquiere el compromiso de colaborar con el Usuario y las autoridades competentes, si as fuera necesario, para facilitar la prueba fehaciente del cargo indebido. En caso de fraude, Zabor se reserva el derecho a interponer las acciones que en su caso fueran menester cuando resulte perjudicado por el uso indebido del sitio.</p><p>Funcionamiento del servicio. Condiciones del Mandato.</p><p>Cuando un Usuario registrado como Cliente necesite ayuda con un recado, deber dirigirse a la plataforma web o a la correspondiente aplicacin de Zabor y solicitar el servicio mediante dichos medios telemticos. El servicio de recadera bsico consiste en la recogida de un producto y su posterior entrega, ambas direcciones establecidas por el Cliente siempre que se encuentren exclusivamente dentro del territorio de actuacin de Zabor. Asimismo, el Cliente puede solicitar al Mandatario que compre presencialmente productos en su nombre, los recoja y los entregue en las direcciones consignadas, a travs de mandato el Mandatario se compromete a adquirir los productos encomendados por el Cliente en su nombre, y segn las indicaciones y especificaciones brindadas por este ltimo.</p><p>El Cliente es el nico responsable en la correcta consignacin de las direcciones de entrega y recogida en la Plataforma, por lo que exime a Zabor y al Mandatario de cualquier negligencia o error en la recogida o entrega del pedido derivada de la consignacin errnea de las direcciones de entrega y recogida. Como consecuencia de ello, ser el Cliente quin deba asumir el coste derivado de la incorrecta consignacin de las direcciones de entrega y recogida en la Plataforma.</p><p>El Cliente deber proporcionar toda la informacin, lo ms detallada posible, respecto al servicio objeto del recado, y en su caso, en relacin con el producto que solicite comprar al Mandatario en su nombre en las tiendas fsicas. Para ello, podr introducir los comentarios que considere tiles en el apartado comentarios, as como en su caso, podr compartir con el Mandatario una fotografa para identificar el pedido. El Cliente tendr comunicacin constante con el Mandatario, pudindose dirigir en todo momento al Mandatario a los efectos de que ste ejecute el mandato conferido segn las propias indicaciones de Cliente.</p><p>A efectos de facilitar la comunicacin directa con el mandatario y en el supuesto que exista alguna incidencia en la tramitacin del encargo y/o para comunicar algn cambio en el mismo, ZABOR pone a disposicin de los usuarios un chat interno que permitir el contacto directo e inmediato entre usuario y mandatario durante la ejecucin del pedido. El chat dejar de estar activo en el momento en que el usuario haya recibido el producto o se haya cancelado por cualesquiera de las causas previstas. En el supuesto que el usuario quiera comunicarse con el mandatario o con Zabor tras la finalizacin del encargo, deber utilizar el formulario de contacto presente en la Plataforma y contactar con el servicio de atencin al cliente.</p><p>El Cliente exime a Zabor y al Mandatario de cualquier negligencia o error en las indicaciones que consigne para la compra del producto que solicite comprar en su nombre a las tiendas fsicas. Como consecuencia de ello, ser el Cliente quin deba asumir el coste derivado de la incorrecta consignacin de las indicaciones de los productos en la Plataforma (i.e. direccin incorrecta, producto incorrecto).</p><p>En la medida que en la plataforma no conste el precio del producto/y o servicio y dado que los precios consignados en la Plataforma son orientativos, el Cliente podr fijar un precio aproximado. En este caso, el servicio o producto podr ser adquirido presencialmente por el Mandatario de acuerdo con lo que el Cliente haya estimado y nunca por una cantidad superior al _____% de dicha estimacin. En el caso que el precio sea ms alto, el Mandatario se comunicar con el Cliente para informarle de esta situacin y ser este ltimo quin tome la decisin final de proceder o no con la compra presencial en tienda. Zabor, con la nica finalidad de ayudar al Usuario, podr facilitar una estimacin aproximada del precio, sin que ningn caso dicha estimacin pudiera resultar vinculante con el precio final que deba abonar el Usuario.</p><p>Si el producto y/o servicio no se encuentra disponible, el Mandatario deber llamar al Cliente para exponerle las opciones. En caso de que el Cliente no se encuentre de acuerdo con ninguna de las opciones expuestas por el Mandatario y, consecuentemente, no est interesado en las opciones alternativas, deber asumir la poltica de cancelacin expuesta en las presentes Condiciones Generales de Uso (en el apartado nueve). Si el Cliente no responde a las llamadas, el Mandatario esperar 5 minutos antes de marcharse.</p><p>En los supuestos en los que el Cliente no se encontrase en el lugar consignado para la entrega, el Mandatario conservar el producto durante 24 horas, o 5 minutos en el caso de productos perecederos. Asimismo, el Cliente deber asumir el 100% del coste del servicio de recadera bsico, as como del precio del producto en el caso de que se haya adquirido o contratado alguno a travs del Mandatario por encargo del Cliente, y deber volver a pagar otro servicio para recibir los productos no entregados. El Mandatario en ningn caso ser responsable del deterioro o de la caducidad del producto objeto del recado.</p><p>Una vez finalizado el encargo, en el caso de que se haya solicitado la adquisicin presencial de un producto, el Mandatario entregar al Cliente el recibo fsico correspondiente a dicho producto, y/ o a travs de correo electrnico. Si el recado tiene por objeto la mera entrega de un producto, el Mandatario se lo entregar al Cliente en el lugar y momento exacto en que ste ltimo le indique. Todo ello sin perjuicio del recibo electrnico por el servicio que recibir el Cliente en la direccin de correo asociado a su cuenta.</p><p>En ese momento, el Usuario, destinatario del servicio identificado por el usuario en el pedido, o cualquier tercero autorizado por el mismo, deber ratificar el mandato conferido mediante su firma en el dispositivo del Mandatario. Zabor no puede comprobar la veracidad de la firma realizada por el Usuario. En el supuesto que el Usuario reciba confirmacin de la realizacin del recado sin haber procedido a la ratificacin del mandato por s mismo o mediante un receptor autorizado por este, deber comunicarlo a Zabor de forma inmediata para que la Plataforma pueda tomar las medidas oportunas a tal efecto. Zabor se reserva el derecho a comprobar las comunicaciones realizadas por el Usuario en este sentido a efectos de su corroboracin y control.</p><p>ALIMENTACIN/PRODUCTOS ENVASADOS: Zabor recomienda al Usuario que cuando encargue productos alimenticios por mandato solicite al Mandatario y/o al restaurante o establecimiento ofertante, a travs de los medios facilitados por la Plataforma, la informacin relativa al contenido y composicin de los productos alimenticos encargados.</p><p>Devolucin de productos</p><p>En caso de que el Cliente desee proceder a la devolucin de un producto o desee realizar una reclamacin acerca de la realizacin de un servicio, sin perjuicio de que Zabor, como intermediario, asuma la gestin de la misma, el responsable final siempre ser el comercio en el cual se realiz la compra. En caso de reembolso del importe de la compra al Cliente, ser el comercio el que tendr potestad para decidir el mtodo de devolucin (metlico, tarjeta de crdito, vale de compra) con independencia de que sea Glovo el que por cuenta del comercio local proceda a la devolucin. Por lo tanto, la devolucin de un producto adquirido por el Mandatario en ejecucin del mandato conferido por el Cliente quedar sujeta en todo caso a la poltica de devoluciones del comercio.</p><p>Determinados establecimientos podran no disponer de espacios abiertos al pblico, con lo que el Usuario no podra acceder a los mismos a efectos de tramitar la devolucin o reclamacin. En estos supuestos, el Usuario deber contactar con el servicio de atencin al cliente de Zabor, a travs de los canales presentes en la Plataforma, con la finalidad de obtener la ayuda y soporte necesarios.</p><p>En el caso que el Usuario quiera tramitar la devolucin de algn producto por no adecuarse a lo que ha solicitado a travs de la plataforma, el Usuario deber aportar una fotografa del pedido total junto con un listado de los productos incorrectos o que no se hayan entregado, as como otras evidencias que demuestren la no adecuacin del producto solicitado.</p><p>El Cliente deber comprobar los productos que el Mandatario le entregue en la direccin de entrega antes de proceder a firmar y ratificar el mandato. Con la firma, el Cliente confirma y ratifica el mandato, la compra presencial o servicio realizado en su nombre. Asimismo, el Cliente manifiesta que un tercero podr ratificar el mandato en su nombre, por ejemplo en aquellos supuestos en que el Cliente no se encuentre en la direccin final de entrega o haya designado a un tercero para la recogida y firma. As, recae sobre el Cliente y/o dicho tercero la responsabilidad de verificar la adecuacin del servicio, as como en su caso, recabar las evidencias suficientes para justificar lo contrario.</p><p>En todo caso, ser potestad del comercio determinar en cada caso la procedencia de la devolucin por lo que, en caso de disputa, el Cliente deber ponerlo en conocimiento de Zabor a travs de los medios facilitados por Zabor a tal efecto.</p><p>Tarifas de los servicios y facturacin</p><p>El alta y uso de la Plataforma para los Clientes es completamente gratuita.</p><p>El uso de la Plataforma por parte de los Mandatarios y los comercios puede tener un coste asociado en funcin del lugar destino desde el que deseen hacer uso de la Plataforma para proveer servicios.</p><p>El Cliente nicamente deber pagar por cada servicio solicitado a travs de la Plataforma en concepto del uso de la misma para la solicitud de productos y comunicacin a travs de la Plataforma, y por los servicios de mensajera o recadera prestados por terceros. Adicionalmente, en aquellos servicios que incluyan la compra de un producto, el Usuario deber pagar el precio de dicho producto. El Usuario, al registrarse a travs de la Plataforma y proporcionar la informacin bancaria requerida, autoriza expresamente a Zabor a pasar los recibos correspondientes al pago de los servicios solicitados, incluyendo el precio y la entrega de los productos solicitados.</p><p>El precio total de cada servicio puede componerse de un porcentaje variable en funcin de los kilmetros y tiempo que deba recorrer y utilizar el Mandatario, as como en su caso, del precio fijado por cada comercio para los casos en que el Usuario solicite la compra fsica de un producto o servicio. Zabor se reserva el derecho de modificar el precio en funcin de la franja horaria y/o distancia en la que se realice el servicio. De acuerdo con estas condiciones, el Cliente tendr derecho a saber la tarifa aproximada de su servicio antes de la contratacin del mismo y formalizacin del pago, exceptuando cuando el usuario no especifique la direccin de recogida. La tarifa del servicio de envo podr variar cuando se dieran circunstancias de fuerza mayor que estuvieran fuera del alance de Zabor y que conlleven un aumento de dicha tarifa.</p><p>La tarifa podr incluir propinas para el Mandatario y/o la tienda local cuyo importe depender nica y exclusivamente de la voluntad del Usuario.</p><p>Zabor se reserva el derecho de modificar sus precios en cualquier momento. Los cambios efectuados tendrn efecto inmediato tras su publicacin. El Usuario autoriza expresamente a Zabor para que le remita por medios telemticos, a la direccin de correo electrnica facilitada por el mismo durante el proceso de registro, el recibo de los servicios contratados y/o las facturas generadas. En caso de requerir una factura, el usuario deber aadir los datos fiscales a la plataforma antes de hacer el pedido.</p><p>La cancelacin posterior del servicio por el usuario, cuando ya haya habido confirmacin de preparacin del pedido por parte del comercio local y la misma haya sido comunicada al Usuario, facultar a Zabor a cargar al Cliente la tarifa que en su caso corresponda. Asimismo, en el caso que el Usuario hubiera solicitado al Mandatario la compra de un producto en nombre suyo, si el Cliente cancelara el pedido cuando la adquisicin ya estuviera realizada, asumir los costes de los servicios de envo realizados por el Mandatario, as como del producto. Todo ello sin perjuicio de que el Cliente pueda solicitar un nuevo servicio a los efectos de devolver los productos adquiridos, o que se le entreguen en otra direccin. Para el caso de productos no perecederos, el Usuario podr ejercitar su derecho de desistimiento ante el comercio que le ha vendido los productos. Si desea ejercer el derecho a travs de Zabor, deber contratar el nuevo servicio.</p><p>6.1. Plataformas de pago</p><p>El pago de los productos y/o servicios que se ofertan a travs de la Plataforma, que se venden presencialmente en los Restaurantes y/o tiendas, y que se entregan a los Clientes de forma diferida, se efecta transitoriamente a Zabor y ste lo transmite a los Restaurantes y/o tiendas con los que mantiene un acuerdo comercial. Los Restaurantes y/o establecimientos asociados autorizan a Zabor a aceptar el pago en su nombre, por lo que el pago del precio de cualquier producto (i.e. comida, bebida, regalo) efectuado correctamente a favor de Zabor descargar al Cliente de las obligaciones de abonar dicho precio al Restaurante y/o establecimientos asociados.</p><p>Asimismo, el pago del Cliente le descarga de cualquier obligacin respecto al Mandatario, teniendo el cobro total al Cliente efecto liberatorio sobre cualquier obligacin que pudiera tener con Partners y/o Mandatarios.</p><p>El pago de los productos y/o servicios realizado por los Clientes se recibe en las cuentas de Zabor mediante una Entidad de Dinero Electrnico. Las Entidades de Dinero Electrnico estn autorizadas para proporcionar servicios de pago regulados en todos los lugares en los que opera Zabor y cumplen con la normativa vigente en materia de servicios de pago para Plataformas como Zabor.</p><p>Zabor, a travs del proveedor de pagos que a tal efecto tiene contratado y con el nico objeto de comprobar el medio de pago facilitado, se reserva el derecho, como medida antifraude, a solicitar la preautorizacion de cargo de los productos encargados a travs de la plataforma. La citada preautorizacin no supondr, en ningn caso, el pago total del encargo en tanto ste se realizar nica y exclusivamente tras la puesta a disposicin de los productos al usuario o bien, por las causas descritas en los presentes trminos y condiciones.Zabor, para dar un mayor soporte a los Usuarios, actuar como primer punto de contacto con los mismos y asumir la responsabilidad por los pagos realizados a travs de la plataforma. Esta responsabilidad incluye: reembolsos, devoluciones, cancelaciones y disputas de resolucin, en un estadio inicial, sin perjuicio de las actuaciones que Zabor pueda realizar ante los comercios locales como nicos vendedores fsicos de los productos ordenados por los Usuarios.Siguiendo cuanto descrito, en el supuesto que exista alguna disputa, Zabor ofrecer la primera lnea de soporte y reembolsar al usuario si se considera apropiado.</p><p>Si el Usuario tiene algn problema con el desarrollo de su pedido, podr contactar al servicio de atencin al usuario de Zabor a travs de los medios puestos a disposicin del mismo en la Plataforma.</p><p>Precio de los productos y/o servicios consignados en la PlataformaTodos los precios que se indican en la Plataforma incluyen los impuestos que pudieran ser aplicables en funcin del territorio desde el que opere el Usuario y en todo caso se expresarn en la moneda vigente en funcin del territorio desde el que opere el Usuario.</p><p>De acuerdo con la Clusula 6 anterior, los precios aplicables en cada servicio sern los publicados en la Plataforma sujetos a las particularidades expuestas y aplicados de forma automtica en el proceso de contratacin en la ltima fase del mismo.No obstante, los precios de los productos de venta en restaurantes y/o tiendas mostrados en la Plataforma de Zabor podrn ser orientativos. En todo caso, dichos precios corresponden a los productos de venta en restaurantes y/o tiendas y son exclusivamente fijados por ellos. El Cliente podr comunicarse con el Mandatario a los efectos de confirmar el precio final de los productos solicitados.</p><p>El Usuario asume que en todo caso la valoracin econmica de algunos de los productos podr variar en tiempo real en funcin del establecimiento que los vende y el stock disponible. Para cualquier informacin sobre el pedido solicitado, el Usuario podr contactar con Zabor.De acuerdo con lo anterior, el Cliente mediante la solicitud de compra y envo a travs de la plataforma confiere al Mandatario un mandato para adquirir presencialmente los productos en su nombre por el precio fijado por los comercios. El Cliente podr estar en contacto directo con el Mandatario tanto durante la realizacin del pedido, como en la entrega del mismo para indicar al Mandatario qu producto solicita.</p><p>cdigos promocionales y/o otras ofertas o descuentos&nbsp;Zabor podr facilitar, en cualquier momento y de forma unilateral, crditos para utilizar dentro de la Plataforma o envos gratis a ciertos usuarios. El Usuario reconoce y acepta que los crditos y envos gratis debern ser utilizados dentro de los seis (6) meses a contar desde la fecha en la que se pone el crdito o envo gratis a disposicin del Usuario en la Plataforma.</p><p>Los cdigos promocionales y/o otras ofertas o descuentos ofertados a travs de la Plataforma debern ser correctamente consignados en la aplicacin con anterioridad a la realizacin del pedido, en caso contrario su uso no ser efectivo para el Usuario y no podr disfrutar de los mismos.&nbsp;Siempre que una cancelacin sea instada por Zabor en los trminos descritos en el apartado 9 siguiente, el Cliente mantendr la vigencia del cdigo promocional y/o otras ofertas o descuentos para su uso futuro. Cuando la cancelacin sea instada por el Usuario se estar a lo previsto en el apartado 9 siguiente.</p><p>Zabor se reserva el derecho a cancelar los cdigos promocionales y/o otras ofertas o descuentos ofertados de forma unilateral, cuando tenga conocimiento de un uso fraudulento de los mismos (i.e. canjear un cdigo promocional cuando no se es el destinatario legtimo del mismo, transmisin masiva de cdigos, vender descuentos o cdigos, ....), cuando haya expirado el plazo anteriormente mencionado y, asimismo, se reserva el derecho a aplicar sanciones a los usuarios por el importe del uso defraudado a la Compaa.&nbsp;Zabor no asume ninguna responsabilidad si, por fuerza mayor o sucesos que escapen de su voluntad o cuya necesidad sea justificada, se viera obligado a anular, acortar, prorrogar o modificar las condiciones de las promociones.&nbsp;En particular, Zabor no asume ninguna responsabilidad en caso de que la pgina web no estuviese disponible en algn momento durante las promociones o de un mal funcionamiento del sistema automatizado de las promociones.</p><p>Derecho de desistimiento y cancelacin de pedidos</p><p>De acuerdo con la propia naturaleza del servicio que ofrece Zabor, el Usuario es consciente de que una vez un Mandatario haya aceptado voluntariamente un pedido, se considera que la ejecucin del mandato de compra ha comenzado y por tanto el Usuario podra no tener derecho a desistir en la solicitud del servicio de forma gratuita.</p><p>Sin perjuicio de lo anterior, los costes de cancelacin podran depender de los siguientes factores;</p><p>Si el restaurante o establecimiento ha aceptado y ha empezado a preparar el pedido, se cobrar el importe de los productos. La aceptacin por parte del restaurante se comunicar al usuario a travs de la Plataforma y/o a travs del envo de correo electrnico a la direccin registrada por el usuario.</p><p>Si el usuario cancela el pedido una vez el Mandatario ha aceptado su tramitacin, se cobrar el importe de la tasa de cancelacin al usuario. Se comunicar al usuario la aceptacin por parte del Mandatario a travs de la Plataforma.</p><p>En el supuesto que el restaurante o establecimiento y el Mandatario hayan aceptado la tramitacin del pedido, se le cobrar al usuario el precio de los productos y la tasa de cancelacin.</p><p>El Usuario podr consultar los costes de cancelacin totales por cada orden a travs del botn Cancelar presente en la Plataforma. De forma previa, se mostrar al Usuario el cargo que se aplicar segn los factores anteriormente descritos.</p><p>Para determinadas ciudades, los costes de cancelacin podran no ser visibles directamente desde la Plataforma. Para esos casos, los costes de cancelacin que aplicarn sern los previstos en el Anexo II de las presentes Condiciones.</p><p>Si adems, en el momento de cancelacin del servicio, el Mandatario ya hubiese realizado la compra encomendada del producto o la contratacin de un servicio, el usuario podr encargar al Mandatario que realice la devolucin del mismo. A tal efecto, el Usuario deber satisfacer el coste total de adquisicin de los productos y los costes de entrega, as como el coste del servicio de devolucin. En el supuesto que el Mandatario haya podido realizar la devolucin del producto, se le reintegrar al Usuario el valor del producto, debiendo ste, como se ha dicho, pagar el coste de los dos servicios de recogida y entrega, as como de devolucin. La devolucin en todo caso estar sujeta a las polticas de devolucin del comercio, por lo que el Cliente manifiesta ser conocedor que en el caso de productos perecederos (i.e. comida), es posible que no se pueda proceder a la devolucin y por lo tanto, Zabor quedar facultado para cargar tanto el producto que el Mandatario ya hubiera adquirido bajo su mandato, como el servicio de envo incurrido.</p><p>En el caso que el Cliente haya indicado de forma incorrecta la direccin de entrega de los productos, podr consignar una nueva direccin en cualquier momento siempre que se encuentre dentro de la misma ciudad del encargo inicial y siempre y cuando esta sea una ciudad dnde Zabor ofrece su servicio de intermediacin. En ese caso, el Cliente estar encargando la contratacin de un nuevo servicio y acepta que se le carguen los importes correspondientes a la nueva entrega. En caso de encontrarse en otra ciudad de la inicialmente indicada, sta no podr modificarse para entregarse en una nueva ciudad y el encargo se cancelar, debiendo el Cliente asumir los costes generados segn se establece en esta clusula.</p><p>Zabor se reserva el derecho a cancelar un pedido sin necesidad de alegar causa justa. En caso de cancelacin instada por Zabor, el Usuario tendr derecho al reembolso de la cantidad abonada.</p><p>Zabor dispone de hojas de reclamacin oficiales a disposicin del consumidor, por el objeto del servicio ofrecido por Zabor, en los idiomas oficiales de los pases dnde Zabor opera. Las mencionadas hojas de reclamacin podrn solicitarse por parte del consumidor a travs del servicio de atencin al cliente de Zabor y ser remitida de forma automtica la opcin para acceder a las mismas. El consumidor deber especificar en el correo electrnico y la ubicacin exacta desde la que realiza la solicitud que deber coincidir con el lugar de realizacin del servicio, en caso de duda, ser este ltimo el lugar dnde deber instarse la reclamacin.</p><p>Condiciones especiales del servicio de encargo de compra de productos a travs de Zabor</p><p>El Cliente tiene la opcin de solicitar a travs de la Plataforma la adquisicin presencial por parte del Mandatario de una serie de productos y/o servicios que son ofrecidos por establecimientos con los que Zabor puede mantener o no un acuerdo comercial. El Cliente puede seleccionar mediante un men desplegable dentro de la Plataforma, una serie de opciones donde se puede indicar de forma orientativa las caractersticas, el precio, as como en ocasiones, hasta una fotografa del producto o servicio.</p><p>En aquellos supuestos en los que el Usuario desee conocer la composicin e informacin nutricional de los productos presentes en la Plataforma, ste deber contactar directamente (mediante contacto facilitado por Zabor para mayor comodidad) con cada establecimiento para que pueda acceder a la informacin completa de los productos.</p><p>Una vez el Cliente seleccione una de las opciones, podr completar adems el pedido mediante un espacio de texto libre para incorporar informacin ms detallada o instrucciones para el Mandatario que se encargue de llevar a cabo dicho pedido.</p><p>A travs del espacio libre, el Cliente manifiesta su voluntad de encargar la compra presencial de determinados productos, resultando el Mandatario un mero mandatario por cuenta de este. Como consecuencia de ello, sera el cliente el nico responsable y quin, llegado el caso, asumira cualquier incidencia derivada de la naturaleza de dichos productos (i.e. sancin, responsabilidad civil y/o penal, responsabilidad patrimonial). A este respecto es importante comunicar al Usuario que Zabor colabora activamente con las autoridades de cada pas con la finalidad de luchar contra el fraude, trfico de estupefacientes, blanqueo de capitales, terrorismo y suplantacin de identidad, entre otros. Por lo tanto, el Usuario es conocedor que Zabor podr comunicar los datos de los mismos a las autoridades pblicas, cuando as lo soliciten, con la finalidad de prevenir y evitar la comisin de estos u otros delitos.</p><p>El Cliente es consciente y acepta que las descripciones y, en su caso, los precios o las fotografas de los productos y/o servicios ofertados en la Plataforma se realizan en base a la informacin y documentacin proporcionada por los Comercios por lo que Zabor no puede ofrecer garantas frente a posibles inexactitudes en dichas descripciones, precios y/o fotografas.</p><p>Asimismo, el Cliente acepta que todos los productos reflejados en la plataforma de Zabor estn sujetos a la disponibilidad de los mismos y en este sentido asume la posibilidad de que durante la realizacin del pedido se encuentre con la no disponibilidad del producto y/o servicio en el Comercio. Adicionalmente, el precio del producto puede variar ligeramente a causa de modificaciones en el punto de venta. Zabor se reserva el derecho de proceder con la compra ante variaciones en el precio de hasta un _____ % si superar el citado _____ % el Mandatario se pondr en contacto con el cliente para transmitirle la situacin.</p><p>Zabor se reserva el derecho a retirar cualquier producto de su plataforma, as como de modificar el contenido de su ficha en cualquier momento, sin que le pueda ser atribuido ningn tipo de responsabilidad.</p><p>10.1 Entregas en el mismo da</p><p>Zabor proporciona al Cliente un servicio de entrega de los productos adquiridos presencialmente por el Mandatario en determinadas ciudades. El pedido se podr realizar siempre que se cumplan las siguientes condiciones en el momento de pago del pedido:</p><p>El servicio se encuentre operativo para la franja horaria escogida.</p><p>La mercanca a entregar debe encontrarse dentro de alguna de las ciudades y dentro del espacio habilitado en las que opere Zabor.</p><p>El lugar de destino debe estar situado en la misma ciudad en la que se encuentre el producto.</p><p>El tamao del pedido no puede superar las medidas: ___________________________</p><p>El peso mximo a cargar en un pedido ser, aproximadamente, de ______ libras*</p><p>*El tamao y peso mencionados anteriormente no aplicarn para los supuestos de vehculos habilitados para dichos volmenes.</p><p>10.2 Precio y mtodo de pago</p><p>El precio del producto y/o servicio ser el indicado por el Comercio a travs de la Plataforma. Sin embargo, el Cliente es conocedor que en todo caso la valoracin econmica de algunos de los productos podr variar en tiempo real, debido a las disponibilidades de stock de los establecimientos que se ofertan en la plataforma, y que en todo caso el coste final ser siempre comunicado al Cliente de forma previa al momento de pago.</p><p>El Cliente tendr contacto continuo con el Mandatario, que actuar en su nombre en la adquisicin de productos y servicios, por lo que cualquier cambio o variacin ser comunicada por el Mandatario de forma previa a la ejecucin del mandato para la aprobacin del Cliente. En caso de querer realizar alguna apreciacin sobre el pedido encargado, el Cliente tendr siempre la posibilidad de contactar directamente con el Mandatario que ejecuta el mandato otorgado.</p><p>De igual forma, durante la pasarela de pago, el Cliente ser informado del precio final del envo y la hora aproximada de entrega segn las condiciones del servicio de recadera de Zabor expresadas ms arriba.</p><p>El Cliente podr realizar el pago de los productos y/o servicios en efectivo o a travs de su tarjeta de crdito. La opcin de pago en efectivo podr no estar disponible en todos los lugares donde opera Zabor. Se informar al Cliente, cuando acceda a realizar el pedido, de las diferentes opciones de pago que tenga segn el territorio desde el que solicite el servicio. Para el pago con tarjeta, el Cliente deber facilitar los datos de la mismas a travs de la plataforma como mtodo de pago asociado a su cuenta. Zabor no almacena el nmero de la tarjeta en sus servidores, y slo podr visualizar los cuatro ltimos dgitos de sta. La informacin completa ser almacenada en los servidores del prestador de servicios de pago que realiza los pagos en nombre de Zabor . El pago con tarjeta de crdito no supondr ningn coste extra para el Cliente. Todo ello de acuerdo con los trminos de la plataforma de pago expuestos en la Clusula 6.1.</p><p>En caso de pago en efectivo, el cliente deber abonar el precio en el momento de la entrega del producto y/o cumplimiento del recado en el lugar de entrega. El cliente no podr negarse a abonar el coste del servicio de entrega y/o el precio del producto solicitado. El cliente nicamente podr negarse a abonar el coste del servicio si ha realizado una queja y ha recibido de parte de Zabor una resolucin favorable del mismo al momento de la entrega.</p><p>Cuando el cobro del servicio al cliente no pudiera realizarse por cualquier motivo, la cuenta del usuario quedar bloqueada en tanto no se regularice y abone la deuda.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;10.3. Envo de muestras gratuitas a domicilio y otras acciones comerciales</p><p>Zabor se reserva el derecho a realizar acuerdos comerciales con Comercios, Grandes Superficies, Empresarios, Profesionales (i.e. empresas de gran consumo del sector alimentacin, laboratorios, Grandes Almacenes, marcas de gran y pequeo consumo) a los efectos de realizar comunicaciones promocionales, incluyendo el envo de muestras gratuitas a domicilio junto al pedido solicitado por el Usuario.</p><p>Condiciones particulares para el servicio</p><p>Zabor, a travs de la Plataforma, pone a disposicin de los Usuarios una categora dnde stos pueden seleccionar entre una gama de productos generalmente presentes, entre otros, en supermercados, grandes almacenes y/o establecimientos de cuidado personal para que el Mandatario, que acepte la tramitacin del recado, pueda entregarlo en la direccin introducida por el usuario.</p><p>El Usuario deber seleccionar los productos en base a sus preferencias y podr solicitar, a travs de los mecanismos previstos en la Plataforma, la informacin relativa a los alrgenos, intolerancias, composicin y/o informacin nutricional de los mismos, que se facilitarn a travs del chat de contacto o a travs del correo electrnico del Usuario registrado en la Plataforma. Asimismo, Zabor podr poner a disposicin de los Usuarios que lo soliciten los enlaces informativos dnde poder encontrar y revisar dicha informacin. Para los pedidos de Zabor  aplicarn las previsiones previstas en el apartado 10.1 anterior.</p><p>Cada Orden podr tener un espacio de texto libre para que el USUARIO pueda agregar los comentarios correspondientes respecto de su Orden, para ser recibidos por el Mandatario a efectos de clarificacin.</p><p>Una vez realizada la orden, el Mandatario se dirigir al/los lugar/es de recogida establecido/s por el Usuario a fin de recoger la/s Orden/es junto con la Confirmacin de la misma en la APP. Para la recogida de la Orden, el Mandatario deber exhibir la Confirmacin de la Orden en la APP. Finalmente, el Mandatario deber entregar la Orden a la/s direccin/es de entrega designada/s.</p><p>El Usuario podr cancelar de forma gratuita la Orden en tanto el Mandatario no la haya aceptado. No obstante, si el Usuario cancela una Orden aceptada por un Mandatario, el Usuario deber pagar el 100% del precio en concepto de cancelacin de una orden ya en curso.</p><p>En el caso que el Mandatario haya llegado a la direccin de entrega y el destinatario de la Orden no aparezca en el plazo de 10 (diez) minutos de espera e intentos de comunicacin, el Mandatario deber devolver la Orden a la direccin inicial de recogida, estando Zabor facultado para cobrar al Usuario los gastos adicionales correspondientes por el nuevo servicio realizado.</p><p>En caso de que el Usuario tenga algn inconveniente durante la solicitud de la Orden, deber contactar al servicio de soporte de ZABOR.</p><p>El pago por el servicio prestado podr ser realizado de las siguientes formas, de libre eleccin por parte del Usuario:</p><p>Tarjeta de crdito: El Usuario podr abonar cada Orden individualmente mediante una tarjeta de crdito en las misma forma y condiciones que las presentes en las Condiciones Generales de Uso y Contratacin</p><p>Pago mensual / domiciliacin bancaria: ZABOR cargar el total generado por el Usuario durante un mes natural mediante domiciliacin bancaria segn la informacin facilitada por el Usuario.</p><p>En caso de desactivacin de la domiciliacin bancaria y, consecuentemente, ante la imposibilidad de realizar el cobro correspondiente, se cargar el importe adeudado por el Cliente en su tarjeta de crdito asociada en el mismo da que ZABOR reciba la devolucin de la domiciliacin. En este supuesto, el cliente deber asumir los costes originados por la devolucin de la domiciliacin (i.e. cargos bancarios).</p><p>Compra de bebidas alcohlicas</p><p>Los Usuarios que realicen un pedido que incluya la adquisicin y/o entrega de bebidas alcohlicas a travs de la plataforma deben ser mayores de edad, habiendo cumplido los 18 aos. Al realizar un pedido que incluya bebidas alcohlicas, el Usuario confirma que tiene al menos 18 aos de edad. Zabor se reserva el derecho de negarse a permitir el pedido de compra y/o entrega de alcohol a cualquier persona que no pueda probar tener al menos 18 aos de edad.</p><p>La presente clusula ser de idntica aplicacin a cualquier otro producto y/o servicio anlogo reservado a la mayora de edad segn legislacin vigente y que sea solicitado por un Usuario a travs de la Plataforma.</p><p>Asimismo, en los casos y en las ciudades en que se encuentre restringida la venta y/o entrega de bebidas alcohlicas en determinada franja horaria, el Usuario es responsable de realizar pedidos en los horarios permitidos segn la normativa de aplicacin. Zabor se reserva el derecho a negarse a permitir el pedido de compra y/o entrega de alcohol fuera de los horarios permitidos.</p><p>Productos en oficinas de farmacia</p><p>Zabor no realiza la venta ni publicidad de medicamentos de uso humano a travs de la Plataforma cumpliendo con la normativa vigente. Los Mandatarios actan como mandatarios de aquellos Usuarios que solicitan medicamentos de uso humano no sujetos a prescripcin mdica a travs de la Plataforma para su recogida.</p><p>Zabor garantiza en todo caso a los Usuarios el consejo farmacutico antes de solicitar sus medicamentos, para ello ZABOR ha habilitado una casilla en SOLICITUD ESPECIAL para que en caso de duda por parte del Usuario consulte al farmacutico que dispensar el producto o productos a travs del mismo todo ello con la finalidad que el Farmacutico pueda dispensar el producto adecuado.</p><p>En cualquier caso, Zabor no se hace responsable del uso que hagan los Usuarios de los productos solicitados en la seccin de Farmacia as como tampoco responder por las cantidades y/o condiciones de los productos que se dispensen en las oficinas de farmacia.</p><p>Adicionalmente, la Plataforma podr ceder a la farmacia que dispense el medicamento solicitado por el Usuario, el nombre de usuario y telfono de ste, a efectos de responderle a las cuestiones planteadas. Dicha cesin estar sujeta en todo caso a la autorizacin expresa e inequvoca del Usuario de acuerdo con la legislacin aplicable en materia de proteccin de datos de carcter personal.</p><p>14. .Geolocalizacin</p><p>Zabor podr recoger, utilizar y compartir datos precisos sobre localizaciones, incluyendo la localizacin geogrfica en tiempo real del ordenador o dispositivo mvil del Usuario, siempre que el Usuario lo autorice. Estos datos de localizacin pueden ser recogidos y utilizados por Zabor para mostrar a los Usuarios la ubicacin del origen de un recado y/o la ubicacin del origen de destino. En este sentido, los Usuarios consienten expresamente que sus datos de geolocalizacin sean compartidos con otros Usuarios y Proveedores para poder llevar a xito el recado solicitado en cada momento. Los Usuarios podrn optar por desactivar la Geolocalizacin en sus dispositivos segn se detalla en la Poltica de Privacidad de Datos.</p><p>Es responsabilidad del Usuario consignar correctamente las direcciones de recogida y entrega. En este sentido, Zabor no se responsabiliza de error u omisin en la consignacin de las mismas por parte del Usuario.</p><p>Obligaciones del Usuario</p><p>Los Usuarios son completamente responsables del acceso y correcto uso de su perfil y dems contenidos de la Plataforma con sujecin a la legalidad vigente, sea nacional o internacional del Pas desde el que hace uso de la Plataforma, as como a los principios de buena fe, a la moral, buenas costumbres y orden pblico. Y especficamente, adquiere el compromiso de observar diligentemente las presentes Condiciones Generales de Uso.</p><p>Los Usuarios son responsables de consignar correctamente nombres de usuario y contraseas individuales, no transferibles y lo suficientemente complejas, as como no usar el mismo nombre de usuario y contrasea que en otras plataformas, todo ello con la finalidad de proteger su cuenta del uso fraudulento por parte de terceros ajenos a la plataforma.</p><p>Los Usuarios se abstendrn de usar su perfil y el resto de contenidos de la Plataforma con fines o efectos ilcitos y que sean lesivos de los derechos e intereses de terceros, o que de cualquier forma puedan daar, inutilizar, afectar o deteriorar la Plataforma, sus contenidos y sus servicios. Asimismo, queda prohibido impedir la normal utilizacin o disfrute de la Plataforma a otros Usuarios.</p><p>Zabor no podr ser considerada responsable editorial, y declara expresamente que no se identifica con ninguna de las opiniones que puedan emitir los Usuarios de la Plataforma, de cuyas consecuencias se hace enteramente responsable el emisor de las mismas.</p><p>Quienes incumplan tales obligaciones respondern de cualquier perjuicio o dao que ocasionen. Zabor no responder de ninguna consecuencia, dao o perjuicio que pudiera derivarse de dicho acceso o uso ilcito por parte de terceros.</p><p>En general, los Usuarios se comprometen, a ttulo enunciativo y no taxativo, a:</p><p>No alterar o modificar, total o parcialmente la Plataforma, eludiendo, desactivando o manipulando de cualquier otra las funciones o servicios de la misma;</p><p>No infringir los derechos de propiedad industrial e intelectual o las normas reguladoras de la proteccin de datos de carcter personal;</p><p>No usar la Plataforma para injuriar, difamar, intimidar, violar la propia imagen o acosar a otros Usuarios; - No acceder a las cuentas de correo electrnico de otros Usuarios;</p><p>No introducir virus informticos, archivos defectuosos, o cualquier otro programa informtico que pueda provocar daos o alteraciones en los contenidos o sistemas de Zabor o terceras personas;</p><p>No remitir correos electrnicos con carcter masivo y/o repetitivo a una pluralidad de personas, ni enviar direcciones de correo electrnico de terceros sin su consentimiento;</p><p>No realizar acciones publicitarias de bienes o servicios sin el previo consentimiento de Zabor.</p><p>Cualquier Usuario podr reportar a otro Usuario cuando considere que est incumpliendo las presentes Condiciones Generales de Uso, asimismo todos los Usuarios pueden informar a Zabor de cualquier abuso o vulneracin de las presentes condiciones, a travs del Formulario de Contacto. Zabor verificar este reporte, a la mayor brevedad posible, y adoptar las medidas que considere oportunas, reservndose el derecho a retirar y/o suspender a cualquier Usuario de la Plataforma por el incumplimiento de las presentes Condiciones Generales de Uso. Asimismo Zabor se reserva el derecho a retirar y/o suspender cualquier mensaje con contenido ilegal u ofensivo, sin necesidad de previo aviso o posterior notificacin.</p><p>Baja del Usuario</p><p>El Usuario podr darse de baja de la Plataforma comunicndolo mediante un correo electrnico a travs del Formulario de Contacto.</p><p>Responsabilidad de Zabor</p><p>El Usuario es responsable de contar con los servicios y equipos necesarios para la navegacin por Internet y para acceder a la Plataforma. En caso de cualquier incidencia o dificultad para acceder a la Plataforma, el Usuario puede informarlo a Zabor a travs de los canales de contacto puestos a disposicin del Usuario, que proceder a analizar la incidencia y dar indicaciones al Usuario acerca de cmo resolverla en el plazo ms breve posible.</p><p>Zabor no controla ni es responsable de los contenidos vertidos por los Usuarios a travs de la Plataforma, siendo estos el nico responsable de la adecuacin legal de dichos contenidos.</p><p>Zabor no responder en caso de interrupciones del servicio, errores de conexin, falta de disponibilidad o deficiencias en el servicio de acceso a Internet, ni por interrupciones de la red de Internet o por cualquier otra razn ajena a su control.</p><p>Zabor no se hace responsable de los errores de seguridad que se puedan producir ni de los daos que puedan causarse al sistema informtico del Usuario (hardware y software), a los ficheros o documentos almacenados en el mismo, como consecuencia de:</p><p>La presencia de un virus en el sistema informtico o terminal mvil del Usuario que sea utilizado para la conexin a los servicios y contenidos de la Plataforma;</p><p>Un mal funcionamiento del navegador;</p><p>Del uso de versiones no actualizadas del mismo.</p><p>18. Responsabilidad por contenidos</p><p>Zabor no tiene obligacin de controlar y no controla la utilizacin que los Usuarios hacen de la Plataforma y, por consiguiente, no garantiza que los Usuarios utilicen la Plataforma de conformidad con lo establecido en las presentes Condiciones Generales de Uso, ni que hagan un uso diligente y/o prudente de la misma. Zabor no tiene la obligacin de verificar y no verifica la identidad de los Usuarios, no la veracidad, vigencia, exhaustividad y/o autenticidad de los datos que los mismos proporcionan.</p><p>Zabor no verificar los productos que puedan recogerse o enviarse a travs de los pedidos realizados a travs de la Plataforma. Por esta razn, tanto el Usuario como el Mandatario eximen a Zabor de cualquier responsabilidad que pudiera derivarse de la puesta a disposicin y/o transporte de productos que requieran permisos o licencias especficos, as como productos prohibidos por cualquier normativa de aplicacin. En el supuesto que Zabor tenga conocimiento que el Usuario y/o el Mandatario utilizan la APP para el transporte de productos prohibidos, podr iniciar una investigacin interna para esclarecer los hechos, interponer las medidas legales necesarias y/o bloquear al Usuario o Mandatario correspondiente hasta la finalizacin de la posible investigacin. Entre las medidas a disposicin de Zabor se encuentra el poner a disposicin de las autoridades los datos e informaciones de los Usuarios y Mandatarios.</p><p>Zabor excluye cualquier responsabilidad por los daos y perjuicios de toda naturaleza que pudieran deberse a la utilizacin ilcita de la Plataforma por parte de los Usuarios o que puedan deberse a la falta de veracidad, vigencia, exhaustividad y/o autenticidad de la informacin que los Usuarios proporcionan a otros Usuarios acerca de s mismos y, en particular, aunque no de forma exclusiva, por los daos y perjuicios de toda naturaleza que puedan deberse a la suplantacin de la personalidad de un tercero efectuada por un Usuario en cualquier clase de comunicacin realizada a travs de la Plataforma. En particular, Zabor no se hace responsable del uso de la aplicacin as como de los pedidos que pudiera realizar un tercero desde la cuenta del Usuario.</p><p>Sin perjuicio de lo anterior, Zabor se reserva la facultad de limitar, total o parcialmente, el acceso a la Plataforma a determinados Usuarios, as como de cancelar, suspender, bloquear o eliminar determinado tipo de contenidos, mediante la utilizacin de instrumentos tecnolgicos aptos al efecto, si tuviese conocimiento efectivo de que la actividad o la informacin almacenada es ilcita o de que lesiona bienes o derechos de un tercero. En este sentido, Zabor podr establecer los filtros necesarios a fin de evitar que a travs del servicio puedan verterse en la red contenidos ilcitos o nocivos. La puesta a disposicin por parte de los Usuarios de contenidos a travs de la Plataforma supondr la cesin a favor de Zabor de todos los derechos de explotacin derivados de los contenidos suministrados en la Plataforma.</p><p>Clusula de \"no garanta\" en los recados ni en los pagos</p><p>Zabor no ofrece ninguna garanta con respecto a la autenticidad, la exactitud, la novedad, la fiabilidad, legalidad o no violacin de derechos de terceros por parte de los Mandatarios. En este sentido, los Usuarios manifiestan que comprenden que Zabor es una plataforma tecnolgica, cuya principal actividad es la intermediacin, esto es, pone en contacto Clientes y Mandatarios, por lo que no asume responsabilidad alguna derivada de la informacin proporcionada por los Mandatarios ni por los daos o prdidas que eventualmente pudieran sufrir por un incumplimiento de las presentes Condiciones Generales de Uso. Al realizar el pedido a travs de la APP y su aceptacin por parte del Mandatario, se establecer una relacin directa entre el Usuario y el Mandatario, siendo Zabor ajena a la misma, facilitando nicamente la APP para que las Partes puedan comunicarse y realizar cuantos pedidos sean necesarios. Por ello Zabor no ser nunca responsable ni de la disponibilidad de los Mandatarios ni del cumplimiento adecuado y satisfactorio de los recados por parte de stos.</p><p>Zabor no realiza confirmacin alguna, ni valida ningn Mandatario ni su identidad ni antecedentes. Sin perjuicio de lo anterior, Zabor puede eventualmente realizar comprobaciones adicionales y poner en marcha procedimientos destinados a ayudar a verificar o a comprobar las identidades de los Mandatarios. En este sentido, cuando un Usuario alcanza el estatus de Mandatario ello simplemente indica que dicho usuario ha completado el proceso de alta correspondiente y ha aceptado las presentes Condiciones Generales de Uso y cualquier otra condicin particular que le resultara aplicable. No implica ni certificacin ni aval acerca de su fiabilidad, idoneidad y/o seguridad por parte de Zabor.</p><p>Por ello Zabor les recomienda a los Clientes que empleen siempre el sentido comn y toda su atencin a la hora de delegar un recado a un determinado Mandatario.</p><p>Al ser miembros de la Plataforma, los Usuarios aceptan que cualquier responsabilidad legal que pretendan ejercitar como consecuencia de acciones u omisiones de otros Usuarios de la Plataforma o terceros se limitar a dichos Usuarios o terceros, no procediendo accin de responsabilidad alguna contra Zabor.</p><p>Actualizacin y Modificacin de la Plataforma</p><p>Zabor se reserva el derecho de modificar, en cualquier momento y sin previo aviso las presentes Condiciones Generales de Uso, la Poltica de Privacidad y la Poltica de Cookies. Los Usuarios debern leer atentamente estas Condiciones Generales al acceder a la Plataforma. En cualquier caso, la aceptacin de las Condiciones Generales ser un paso previo e indispensable al acceso de los servicios y contenidos disponibles a travs de la Plataforma de Zabor App.</p><p>Asimismo, Zabor se reserva la facultad de efectuar, en cualquier momento y sin necesidad de previo aviso, actualizaciones, modificaciones o eliminacin de informacin contenida en su Plataforma en la configuracin y presentacin de sta y de las condiciones de acceso, sin asumir responsabilidad alguna por ello. Zabor no garantiza la inexistencia de interrupciones o errores en el acceso de la Plataforma o a su contenido, ni que sta se encuentre siempre actualizada, no obstante, Zabor llevar a cabo, siempre que no concurran causas que lo hagan imposible o de difcil ejecucin, y tan pronto tenga noticia de los errores, desconexiones o falta de actualizacin en los contenidos, todas aquellas labores tendentes a subsanar los errores, restablecer la comunicacin y actualizar los contenidos.</p><p>Propiedad Intelectual</p><p>Zabor es titular o licenciataria de todos los derechos de propiedad intelectual e industrial incluidos en la Plataforma as como sobre los contenidos accesibles a travs de la misma. Los derechos de propiedad intelectual de la Plataforma, as como: textos, imgenes, diseo grfico, estructura de navegacin, informacin y contenidos que se recogen en ella son titularidad de Zabor, a quien corresponde el ejercicio exclusivo de los derechos de explotacin de los mismos en cualquier forma y, en especial, los derechos de reproduccin, distribucin, comunicacin pblica y transformacin, de conformidad con la legislacin espaola de derechos de propiedad intelectual e industrial.</p><p>An cuanto descrito anteriormente, Zabor</p><p>podra no ser titular ni licenciatario de contenidos como nombres o imgenes, entre otros, de compaas con las cuales Zabor no tiene relacin comercial. En esos supuestos, Zabor adquiere los contenidos de fuentes accesibles al pblico y en ningn caso se entender que Zabor tenga relacin con ningn derecho titularidad de Zabor.</p><p>La autorizacin al Usuario para el acceso a la Plataforma no supone renuncia, transmisin, licencia o cesin total ni parcial sobre derechos de propiedad intelectual o industrial por parte de Zabor. No est permitido suprimir, eludir o manipular de ningn modo los contenidos de la Plataforma de Zabor. Asimismo est prohibido modificar, copiar, reutilizar, explotar, reproducir, comunicar pblicamente, hacer segundas o posteriores publicaciones, cargar archivos, enviar por correo, transmitir, usar, tratar o distribuir de cualquier forma la totalidad o parte de los contenidos incluidos en la Plataforma de Zabor para propsitos pblicos o comerciales, si no se cuenta con la autorizacin expresa y por escrito de Zabor o, en su caso, del titular de los derechos a que corresponda.</p><p>El Usuario que proceda a compartir cualquier tipo de contenido a travs de la Plataforma, asegura que ostenta los derechos necesarios para hacerlo, quedando exento Zabor de cualquier responsabilidad sobre el contenido y legalidad de la informacin ofrecida. La facilitacin de contenidos por parte de los Usuarios a travs de la Plataforma supondr la cesin a Zabor , con carcter gratuito, y con la mxima amplitud permitida por la legislacin vigente, de los derechos de explotacin de propiedad intelectual o industrial derivados de tales contenidos.</p><p>Independencia de las Clusulas</p><p>Si cualquiera de las clusulas de las presentes Condiciones Generales fuera nula de pleno derecho o anulable, se tendr por no puesta. Dicha declaracin de nulidad no invalidar el resto del Contrato, que mantendr su vigencia y eficacia entre las Partes.</p><p>Legislacin Aplicable</p><p>La relacin entre ZABOR y el Usuario, se regir e interpretar de conformidad con las Condiciones Generales que en materia de interpretacin, validez y ejecucin se regirn por la legislacin del Estado Libre Asociado de Puerto Rico; y cualquier controversia se someter a los Tribunales de Justicia de Puerto Rico, salvo que el Usuario solicite los tribunales de su domicilio de residencia.</p><p>Resolucin extrajudicial de conflictos</p><p>Los conflictos o controversias que tuvieran lugar fuera de Puerto Rico quedarn sujetos a su resolucin por parte del Tribunal o de la Cmara de Comercio.</p><p><br></p></div><p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif;\"></p>', 'sdf', '<p>sdfg</p>', '2019-12-16 14:37:10');
