(1, 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration', 'From now on we will keep you informed about promotions, discounts, offers and everything that happens in the gastronomic environment.', 'Desde ahora te mantendremos informado sobre promociones, descuentos, oferta y todo lo que ocurra en el ambiente gastronmico. ', 'Come Join US', 'This is the application that has came to change the way you enjoy your favorite dishes in your preferred restaurants.Zabor App, the delight in your hands !!!', 'Ven y nete a nosotros', 'Esta es la aplicacin que lleg a cambiar la forma de disfrutar tus platos favoritos en tus restaurantes de preferencia.Zabor App, el deleite en tus manos!!!', 'Welcome to our Zabor app!', ' Bienvenidos a nuetra aplicacin Zabor!', '<p>\n              This is the application that came to change the way you enjoy your favorite dishes in your preferred restaurants.Zabor App, the delight in your hands !!!</p>\n            <p>\n              In our application you can share your experience with your friends and acquaintances through social networks (Facebook, Instagram, Twitter). You will enjoy offers, promotions, discounts, you can make reservations, it will include orders and delivery from your favorite food places.\n            </p>\n            <p>\n              Zabor App seeks to improve the service, advertising and income of each customer-restaurant at the gastronomic level by strengthening the slogan Puerto Rico does it better.\n            </p> ', '<p _ngcontent-nye-c3=\"\" style=\"margin-bottom: 20px; font-family: arial, sans-serif; outline-style: initial !important; outline-width: 0px !important;\">Esta es la aplicacin que lleg a cambiar la forma de disfrutar tus platos favoritos en tus restaurantes de preferencia.Zabor App, el deleite en tus manos!!!</p><p _ngcontent-nye-c3=\"\" style=\"margin-bottom: 20px; font-family: arial, sans-serif; outline-style: initial !important; outline-width: 0px !important;\">En nuestra aplicacin podrs compartir tu experiencia con tus amigos y conocidos a travs de las redes sociales ( Facebook, Instagram, Twitter). Disfrutars de ofertas, promociones, descuentos, podrs hacer reservaciones, incluir rdenes y delivery de tus lugares de comida favoritos.</p><p _ngcontent-nye-c3=\"\" style=\"margin-bottom: 20px; font-family: arial, sans-serif; outline-style: initial !important; outline-width: 0px !important;\">Zabor App busca mejorar el servicio, la publicidad y los ingresos de cada cliente-restaurante a nivel gastronmico fortaleciendo el slogan Puerto Rico lo hace mejor.</p>', 'webdata/pic-1589904639796.jpeg', '2020-05-19 14:40:37');
